def testSomething(numberOfNeurons, activationFunctions, featureReduction,
                 numberLoops, loss, printVecs, plotModel, cLM, stepWise, searchForThreshold):
    '''
    Funktion die die einzelnen tests ausführt
    :param numberOfNeurons:
    :param activationFunctions:
    :param featureReduction:
    :param numberLoops:
    :param loss:
    :param printVecs: Boolean, Schreibt die Gewicht und dessen Repräsentation in eine Textdati
    :param plotModel: Boolean, Plotet das neuronale Netz (Funktion ist nicht vollständig)
    :param cLM: Boolean, zur Suche nach dem lokalen Maximum
    :param stepWise:
    :param searchForThreshold:
    :return:
    '''

    nn = NeuralNetwork(numberOfNeurons, activationFunctions, featureReduction,
                 numberLoops, loss, printVectors=printVecs)
    nn.addLayers()

    if searchForThreshold:
        value, growing = nn.fit(stepWise, cLM, searchForThreshold)
        return value, growing
    else:
        nn.fit(stepWise, cLM)
    nn.saveModel()
    if cLM:
        return nn.beginGrowing, nn.stopGrowing, nn.LM

    if plotModel:
        PltData(None).plotNNModel(nn.model.get_weights(), nn.getFileName()+"_model.png")

    del nn
    #plot_model(nn.model, to_file="../images/"+nn.getFileName()+"_model.png", show_shapes=True)

