def testSomethingStochasticHillClimber(numberOfNeurons, activationFunctions, featureReduction,
                 numberLoops, loss, printVecs, standardDeviation, numberOtRandomShots):
    '''
    Startet den Test für den Hill Climber
    :param numberOfNeurons:
    :param activationFunctions:
    :param featureReduction:
    :param numberLoops:
    :param loss:
    :param printVecs:
    :param standardDeviation:
    :param numberOtRandomShots:
    :return:
    '''
    nn = NeuralNetwork(numberOfNeurons, activationFunctions, featureReduction,
                       numberLoops, loss, printVectors=printVecs, standardDeviation=standardDeviation,
                       numberOtRandomShots=numberOtRandomShots, fitByHillClimber=False, checkNewWeightsIsReallyBetter=True)
    nn.addLayers()
    nn.fit()
    print(nn.result)

