def searchForThreshold():
    '''
    Funktion überprüft den Zusammenhang zwischen dem anfänglichem MSE und ob der MSE auf ein lokales Maximum steigt.
    :return:
    '''
    grow = []
    notGrow = []
    i = 0
    while i < 1000:
        value, growing = testSomething(numberOfNeurons=[1, 98, 1], activationFunctions=["linear", "sigmoid", "linear"], featureReduction='mean',
                         numberLoops=100000001, loss='mean_squared_error', printVecs = False, plotModel=False, cLM = False, stepWise=True, searchForThreshold=True)
        if growing:
            grow.append(value)
        else:
            notGrow.append(value)
        print(repr(grow))
        print(repr(notGrow))
        i += 1

