def plotResultCheckLM(beginGrowing, stopGrowing, LM, neurons, path, fileName):
    '''
    Plottet die Daten aus checkLM
    :param beginGrowing:
    :param stopGrowing:
    :param LM:
    :param neurons:
    :param path:
    :param fileName:
    :return:
    '''
    pl = PltData(beginGrowing)
    pl.linePlot(path + "beginGrowing"+ fileName, neurons, xLegend="Anzahl der Neuronen in der versteckten Schicht", yLegend="Anzahl der Loops")

    pl = PltData(stopGrowing)
    pl.linePlot(path + "stopGrowing"+ fileName, neurons, xLegend="Anzahl der Neuronen in der versteckten Schicht", yLegend="Anzahl der Loops")

    pl = PltData(LM)
    pl.linePlot(path + "LM"+ fileName, neurons, xLegend="Anzahl der Neuronen in der versteckten Schicht", yLegend="lokales Maximum")

def checkLM(plotData=True, maxNumberOfNeurons=200, featureReduction = "rfft"):
    '''
    Funktion startet die Untersuchung nach der Größe des lokalen Maximum, der Anzahl der Loops wenn der MSE anfängt zu
    steigen und der Anzahl der Loops wenn das lokale Maximum erreicht ist.
    :param plotData: Boolean, gibt an ob die Daten der Untersuchung direkt geplottet werden sollen
    :param maxNumberOfNeurons: Die Anzahl der Neuronen in der versteckten Schicht. Ab dem übergebenen Wert wird
    sukzessive auf 1 herunter gezählt
    :param featureReduction: die Feature Reudzierungsmethode
    :return: Die Ergebnisse der Untersuchung
    '''
    stopGrowing = np.array([])
    beginGrowing = np.array([])
    LM = np.array([])
    neurons = np.array([])
    i = maxNumberOfNeurons
    while i > 0:
        print("neurons " + str(i))
        bG, sG, lm = testSomething(numberOfNeurons=[1, i, 1], activationFunctions=["sigmoid", "linear"], featureReduction=featureReduction,
                     numberLoops=100000, loss='mean_squared_error', printVecs = False, plotModel=False, cLM = True, stepWise=False, searchForThreshold=False)
        stopGrowing = np.append(stopGrowing, np.array([sG]))
        beginGrowing = np.append(beginGrowing, np.array([bG]))
        LM = np.append(LM, np.array([lm]))
        neurons = np.append(neurons,np.array([i]))
        i -= 1
    result = {"beginGrowing": beginGrowing,
              "stopGrowing": stopGrowing,
              "LM": LM}
    print(result, neurons)
    if plotData:
        plotResultCheckLM(beginGrowing, stopGrowing, LM, neurons, "../results/", "_"+featureReduction+".png")

    return result, neurons

def plotResultCheckLMStatistical(fileName,result, neurons, featureReduction, numberOfExperiments):
    '''
    Plottet die Ergebnisse von checkLMStatistical
    :param fileName:
    :param result:
    :param neurons:
    :param featureReduction:
    :param numberOfExperiments:
    :return:
    '''
    legend = ["AVG", "MAX", "MIN"]
    pl = PltData(result)
    pl.linePlot("../results/statistical_run2_"+fileName+"_"+str(numberOfExperiments)+".png", neurons, width = 1600, xLegend="Anzahl der Neuronen in der versteckten Schicht",
                yLegend="lokales Maximum / Anzahl der Loops", text="feature Reduction: "
                                                                     + featureReduction+ "\nAnzahl der Experimente: " + str(numberOfExperiments), legend=legend, pltDiff=False)

def checkLMStatistical(numberOfExperiments, maxNumberOfNeurons=200, featureReduction = "rfft"):
    '''
    Durchläuft die checkLM Funktion numberOfExperiments mal, berechnet den Maximalwert, den Durchschnitt und das Minimum
    von beginGrowing, stopGrowing, LM
    :param numberOfExperiments:
    :param maxNumberOfNeurons:
    :param featureReduction:
    :return:
    '''
    i = 1
    mSum = {}
    mMax = {}
    mMin = {}
    prob = np.array([0.] * maxNumberOfNeurons)

    while i <= numberOfExperiments:
        print("experiment " + str(i))
        result, neurons = checkLM(False, maxNumberOfNeurons, featureReduction)
        for key, mValue in result.items():
            if i == 1:
                mSum[key] = np.array(mValue)
                mMin[key] = np.array(mValue)
                mMax[key] = np.array(mValue)
            else:
                mSum[key] += mValue
                x = 0
                for value in mValue:
                    if value > mMax[key][x]:
                        mMax[key][x] = value
                    if value < mMin[key][x]:
                        mMin[key][x] = value
                    x += 1
            x = 0
            if key == "LM":
                for value in mValue:
                    print(value)
                    if not value > 0.0:
                        prob[x] += 1
                    x += 1
            result = np.array([mSum[key] / i, mMax[key], mMin[key]])
            plotResultCheckLMStatistical(key, result, neurons, featureReduction, i)
        pl = PltData(prob/i)
        pl.linePlot("../results/statisticalWahrscheinlichkeit_run2_" + str(i) + ".png", neurons,
                        width=1600, xLegend="Anzahl der Neuronen in der versteckten Schicht",
                        yLegend="Wahrscheinlichkeit",
                        text="Wahrscheinlichkeit, dass MSE sofort konvergiert\nAnzahl der Experimente: " + str(i),
                        pltDiff=False)
        i += 1
