def checkScaleOfFunction(numberOfExperiments=400):
    '''
    überprüft den Wertebereich des neuronalen Netzes, ob dieser durch null verläuft und null direkt getroffen wird.
    Plottet anschließend die Ergebnisse
    :param numberOfExperiments:
    :return:
    '''
    data = np.arange(-1000, 1000, 1)
    i = numberOfExperiments
    throughNull = []
    nullIsNull = []
    notThroughNull = []
    featureReduction = "rfft"
    while i > 0:
        nn = NeuralNetwork(numberOfNeurons=[1, 76, 1], activationFunctions=["sigmoid", "linear"],
                           featureReduction=featureReduction, numberLoops=10000, loss='mean_squared_error',
                           printVectors=False)
        nn.addLayers()
        nn.fit(False, False, False, True)
        pData = nn.model.predict(data)
        sc = Functions.calcScale(pData)
        print(i)
        if 0. == round(pData[1000][0],3):
            nullIsNull.append(sc)
        if max(pData)>0 and min(pData)<0:
            throughNull.append(sc)
        else:
            notThroughNull.append(sc)
        i-=1
    data = [throughNull, notThroughNull, nullIsNull]
    plt = PltData(None)
    plt.plotPoints(data, ["durch Null", "nicht durch Null", "null wird auf null abgebildet"], "../results/"+ nn.getFileName() + "throughNull_notThroughNull_-1000_1000.png", "Größenordnung der Skala ")
