def plotValueRepresentation(numberOfExperiments=1):
    '''
    Plottet die Wert-Repräsentation die als Eingabe in das Netz dient.
    :param numberOfExperiments: Anzahl der Ausführung
    :return: Plots in /results/valueRepresentation/
    '''
    i = 1
    featureReduction = "mean"
    legend = []
    while i <= numberOfExperiments:
        nn = NeuralNetwork(numberOfNeurons=[1, 600, 1], activationFunctions=["sigmoid", "linear"],
                           featureReduction=featureReduction, numberLoops=10000, loss='mean_squared_error', printVectors=False)
        nn.addLayers()
        nn.fit(False, False, False)
        data = np.array(nn.dataHistory)
        data = np.reshape(data, (-1, len(data)))
        text = "konvergiert "
        if sum(nn.result[-1000:]) == 0.0:
            text += "TRUE"
        else:
            text += "FALSE"
        pl = PltData(data)
        pl.linePlot("../results/valueRepresentation/" + nn.getFileName() + "_run_" +str(i)+ ".png",
                    width=1600, xLegend="Anzahl der Loops", text=text,
                    yLegend="Wert Repräsentation " + featureReduction, pltDiff=False)
        legend.append("run " + str(i))
        i+=1

plotValueRepresentation()

